import React from "react";
import "../../../Styles/Pages/Faq/FaqHeader.scss";

function FaqHeader() {
  return (
    <div className='faqHeader'>
      <h1>Frequently Asked Questions</h1>
      <div className='faqInput'></div>
    </div>
  );
}

export default FaqHeader;
